import PySimpleGUI as sg
import requests
import subprocess
import getpass

flower_base64 = "data:image/png;base64,"

class Anonsurf:
    def __init__(self) -> None:
        self.status = [('Status : \u2B24'+' Disconnect', 'red'), ('Status : \u2B24'+' Connect', 'green'), ('Status : \u2B24'+' Restarting..', 'yellow')]
        self.state = 0

    @classmethod
    def Start(self):
        try:
            subprocess.check_output("anonsurf start", shell=True, text=True)
        except:
            pass

    @classmethod
    def Stop(self):
        try:
            subprocess.check_output("anonsurf stop", shell=True, text=True)               
        except:
            pass

    @classmethod
    def Restart(self):
        try:
            subprocess.check_output("anonsurf restart", shell=True, text=True)
        except:
            pass

    @classmethod
    def ChangeIdentity(self):
        try:
            subprocess.check_output("anonsurf restart", shell=True, text=True)
        except:
            pass

    def GetMyIP():
        try:
            req = requests.get("https://api.ipify.org/?format=json").json()
            return req["ip"]
        except:
            return "Unknown"

    def Run(self) -> None:
        sg.theme("Dark Grey 15")

        layout_img = [
            [sg.Button("", image_data=flower_base64[22:], button_color=(sg.theme_background_color(),sg.theme_background_color()),border_width=0)],
            [sg.Text("AnonSurf GUI", pad=(40, 1), font=("Ubuntu", 20))],
            [sg.Text(text=self.status[self.state][0], text_color=self.status[self.state][1], pad=(46, 1),
            justification='center', font=("Courier New", 10), key='INDICATOR')]
        ]

        layout_btn_one = [
            [sg.Button("Start"), sg.Button("Stop"), sg.Button("Restart")]
        ]

        layout_btn_two = [
            [sg.Button("Change Identity"), sg.Button("My IP"), sg.Button("Exit")]
        ]

        layout_copyright = [
            [sg.Text("Created By X - MrG3P5")],
        ]

        layout = [
            [sg.Column(layout_img, justification="center")],
            [sg.Column(layout_btn_one, justification="center")],
            [sg.Column(layout_btn_two, justification="center")],
            [sg.Column(layout_copyright, justification="center")]
        ]

        window = sg.Window("Anonsurf GUI", layout, element_justification="c")

        while True:
            event, value = window.read()
            if event in ("-close-", "Exit") or event is None:
                break
            elif event == "Start":
                Anonsurf.Start()
                self.state = 1
            elif event == "Stop":
                Anonsurf.Stop()
                self.state = 0
            elif event == "Restart":
                Anonsurf.Restart()
                self.state = 1
            elif event == "Change Identity":
                Anonsurf.ChangeIdentity()
                self.state = 1
            elif event == "My IP":
                sg.popup_no_buttons(f"Your IP : {Anonsurf.GetMyIP()}", title="AnonSurf GUI", font=("Ubuntu", 15))
            if event in ("Stop", "Start"):
                value, text_color = self.status[self.state]
                window["INDICATOR"].update(value=value, text_color=text_color)

if __name__=="__main__":
    if getpass.getuser() == "root":
        App = Anonsurf()
        check_out = subprocess.check_output("anonsurf status", shell=True, text=True)

        if "Active: active (exited)" in check_out:
            App.state = 1
        else:
            App.state = 0

        App.Run()
    else:
        exit(f"[!] Please Running this script on root!")